decr:
firma a pessoa supra citada intimada a:
cumprir da integra termo de intimação n 14500
manter o local livre de criadouros de mosquito da dengue;
organizar área externa
providenciar local para a guarda de materiais e utensílios de limpeza;
reparar infiltrações na parede;
reparar infiltrações no forro na sala de consumação;
acondicionar lixo em recipientes com tampa sem acionamento manual;
